    <script>
        var TOTAL_TIME = 0.00;
        function rangeCalc(totalTime, rateOfChange, wait){
          console.log("range: " + (rateOfChange * totalTime) / wait);
        }
        function waitTimeCalc(totalTime, range, rateOfChange){
          console.log("waitTime: " + (totalTime * rateOfChange) / range);
        }
        function rateOfChangeCalc(totalTime, range, wait){
          console.log("rateOfChange: " + (range * wait) / totalTime);
        }
        function totalTimeCalc(range, rateOfChange, wait){
          var totalTime = (range / rateOfChange) * wait;
          console.log("=============\ntotalTime: " + totalTime);
          return totalTime;
        }
        function sleep(sleepFunction, element, range, wait){
            var i = 0.00;
            (function loop () {
                setTimeout(function () {
                    if (i < range) {          // If i > 0, keep going
                        i = i + wait;
                        loop();       // Call the loop again, and pass it the current value of i
                    }
                    else{
                      sleepFunction(element);
                    }
                }, wait);
            })(1);
        }
        function animate(animationFunction, element, range, rateOfChange, wait, mute){
            if(mute == false){
              TOTAL_TIME = totalTimeCalc(range, rateOfChange, wait);
              rateOfChangeCalc(TOTAL_TIME, range, wait);
              waitTimeCalc(TOTAL_TIME, range, rateOfChange);
              rangeCalc(TOTAL_TIME, rateOfChange, wait);
            }

            var i = 0.00;
            (function loop () {
                animationFunction(element, i);
                setTimeout(function () {
                    if (i < range) {          // If i > 0, keep going
                        i = i + rateOfChange;
                        loop();       // Call the loop again, and pass it the current value of i
                    }
                }, wait);
            })(1);
        }
        function enhanceStroke(element, i){
            element.setAttribute("stroke-width", i);
        }
        function expand(element, i){
            element.setAttribute("width", i);
        }
        function nudgeUp(element, i) {
            var value = parseFloat(element.getAttribute("y"), 10);
            element.setAttribute("y", value - i);
        }
        function nudgeDown(element, i) {
            var value = parseFloat(element.getAttribute("y"), 10);
            element.setAttribute("y", value + i);
        }
        function nudgeLeft(element, i) {
            var value = parseFloat(element.getAttribute("x"), 10);
            element.setAttribute("x", value - i);
        }
        function nudgeRight(element, i) {
            var value = parseFloat(element.getAttribute("x"), 10);
            element.setAttribute("x", value + i);
        }
        function showHide(element){
            if(element.style.display == "none"){
              element.style.display = "block";
            }
            else{
              element.style.display = "none";
            }
        }

        /////////////////////////////////////////////////////////////////
        // Animation Globals.                                          //
        /////////////////////////////////////////////////////////////////
        var topBar = document.getElementsByClassName("cls-16")[0];
        var topBarCapacity = topBar.getAttribute("width");
        var middleBar = document.getElementsByClassName("cls-15")[0];
        var middleBarCapacity = middleBar.getAttribute("width");
        var bottomBar = document.getElementsByClassName("cls-14")[0];
        var bottomBarCapacity = bottomBar.getAttribute("width");
        var goldenHilites = document.getElementsByClassName("cls-7");
        var smallGoldenBracket = document.getElementsByClassName("cls-5")[0];
        var sexSymbolParts = document.getElementsByClassName("cls-4");
        var arrowShaft = sexSymbolParts[3];
        var arrowHead = sexSymbolParts[2];
        var crossVertical = sexSymbolParts[0];
        var crossHorizontal = sexSymbolParts[1];

        /////////////////////////////////////////////////////////////////
        // Hides all parts that animate later.                         //
        /////////////////////////////////////////////////////////////////
        //hide bar graph.
        animate(expand, topBar, 0.0, 1.0, 5, true);
        animate(expand, middleBar, 0.0, 1.0, 5, true);
        animate(expand, bottomBar, 0.0, 1.0, 5, true);
        //hide sex symbol ends.
        crossHorizontal.style.display="none";
        arrowHead.style.display="none";
        //hide sex symbol shafts.
        animate(nudgeDown, arrowShaft, 3.00, 0.1, 5, true);
        animate(nudgeUp, crossVertical, 4.00, 0.1, 5, true);

        //Have below code execute after the intersection observer is in view of the info graphic.
        sleep(topBarAnimations, this, 3000, 1000);
        sleep(sexSymbolAnimations, this, 6000, 1000);
        sleep(goldAnimations, this, 10000, 1000);

        function topBarAnimations(){
            //show gold bar graph.
            animate(expand, topBar, topBarCapacity, 0.5, 5, false);
        }

        function sexSymbolAnimations(){
            //show light blue bar graph.
            animate(expand, middleBar, middleBarCapacity, 0.1, 5, true);
            //show sex symbol shafts.
            animate(nudgeUp, arrowShaft, 3.00, 0.1, 70, true);
            animate(nudgeDown, crossVertical, 4.00, 0.1, 70, true);
            //show sex symbol ends.
            sleep(showHide, crossHorizontal, 2000, 1000);
            sleep(showHide, arrowHead, 2000, 1000);
        }

        function goldAnimations(){
            //show gold bar graph.
            animate(expand, bottomBar, bottomBarCapacity, 0.1, 5, false);
            //show gold hilited 20.
            animate(enhanceStroke, goldenHilites[0], 6.00, 0.01, 5, false);
            animate(enhanceStroke, goldenHilites[1], 6.00, 0.01, 5, true);
            animate(enhanceStroke, smallGoldenBracket, 3.00, 0.01, 5, false);
        }

    </script>
